Information
------------------------------

Earth Collection 
An amazing Earth DVD collection will let you in on the secrets of the moon, the sun and the Earth. And everything in between. Join scientists and explorers as they cover every facet of our planet and beyond. The Earth series DVDs are a two-disc set of fascinating landscapes, human and animal life and much more.


1)  Inside Planet Earth 
Humans have explored the moon a quarter million miles away, yet more than 99 percent of Earth remains unexplored. But this final frontier isn't on the surface of the Earth. Below the rain forests and the mountains are thousands of miles of inaccessible rock and metal, searing heat, and crushing pressure. But what if a crack could be opened all the way to the centre of the Earth? The Earth is like an onion, divided into layers. Each layer plays a vital role in making the world a place where life can survive. Above Ground: The outermost layer, the atmosphere, is painfully thin. It makes up just one percent of the volume of the planet. The journey begins by discovering what it's like to free-fall through 19 miles of atmosphere - a feat accomplished by American legend Joe Kittinger in the 1960s. Narrated By Simon Kerr



